let randomNumber;
let wordToGuess;
let countLetters;
let lives;
let textToGuess = [];
let indexFrame;
let playerLetters = [];
let addToText = [];
let showLetters = false;


function singlePlayer() {
  document.getElementById('startSinglePlayer').disabled = true;
  document.getElementById('startMultiPlayer').disabled = true;
  wordToGuess = pickWord();
  startGame();
}

function multiPlayer(){
  document.getElementById('startSinglePlayer').disabled = true;
  document.getElementById('startMultiPlayer').disabled = true;
  playerKeyboard();
}

function startGame() {
  countLetters = 0;
  lives = 10;
  indexFrame = 0;
  document.getElementById('hide').style.display = 'block';
  document.getElementById('hangman').src = './images/0nn.png';
  let word = document.getElementById('word');
  for (let letterIndex = 0; letterIndex < wordToGuess.length; ++letterIndex) {
    textToGuess[letterIndex] = document.createElement('input');
    textToGuess[letterIndex].className = 'inputLetters';
    textToGuess[letterIndex].placeholder = '_';
    word.appendChild(textToGuess[letterIndex]);
  }
  setLife();
  addKeyboard();
}


function pickWord() {
  randomNumber = getRandomNumber(wordList);
  let wordToGuess = wordList[randomNumber];
  return wordToGuess.toUpperCase();
}

function getRandomNumber(wordList) {
  return Math.floor(Math.random() * wordList.length);
}


function setLife() {
  let life = document.getElementById('life');
  life.style.display = "block";
  life.className = 'showLives';
  life.innerHTML = `You have ${lives} tries left`;
  if (lives === 0) {
    keyboard.innerHTML = "";
    for (let letterIndex = 0; letterIndex < wordToGuess.length; ++letterIndex) {
      if (textToGuess[letterIndex].value == "") {
        textToGuess[letterIndex].className = 'remainedLetters';
        textToGuess[letterIndex].value = wordToGuess.charAt(letterIndex);
      }
    }
    document.getElementById('life').innerHTML = "YOU LOST !!!"
    //alert('Game over');
  }
}

function addKeyboard() {
  let alphabet = [];
  let upcase;
  for(i = 10; i < 36; ++i){
    upcase = i.toString(36);
    alphabet += upcase.toUpperCase();
  }
  let keyboard = document.getElementById('keyboard');
  for (let buttonIndex = 0; buttonIndex < alphabet.length; ++buttonIndex) {
      let button = document.createElement('button');
      button.innerHTML = alphabet[buttonIndex];
      button.value = alphabet[buttonIndex];
      button.className = 'keyboardButtons';
      button.onclick = function() {
        click(button);
      };
      keyboard.appendChild(button);
  }
}

function playerKeyboard() {
  let alphabet = [];
  let upcase;
  let life = document.getElementById('life');
  life.className = 'showLives';
  life.innerHTML = `Add one word and then press > button`;
  // document.getElementById('word').className = 'inputLetters';
  // document.getElementById('word').innerHTML ="AddWord";
  for(i = 10; i < 36; ++i){
    upcase = i.toString(36);
    alphabet += upcase.toUpperCase();
  }
  alphabet = alphabet + ">";
  let keyboard = document.getElementById('keyboard');
  for (let buttonIndex = 0; buttonIndex < alphabet.length; ++buttonIndex) {
      let button = document.createElement('button');
      button.innerHTML = alphabet[buttonIndex];
      button.value = alphabet[buttonIndex];
      button.className = 'keyboardButtons';
      button.onclick = function() {
        if (button.value == ">") {
          word.innerHTML = "";
          document.getElementById('newWord').innerHTML = "";
          keyboard.innerHTML = "";
          life.innerHTML="";
          if(!wordList.includes(wordToGuess)){
            wordList.push(wordToGuess);
          }
          startGame();
        } else {
          if(document.getElementById('word').innerHTML =="AddWord"){
            document.getElementById('word').innerHTML ="";
          }
          playerClickedLetters(button);
        }
      };
      keyboard.appendChild(button);
  }
}

function playerClickedLetters(button) {
  let playerword = document.getElementById('newWord');
  playerLetters += button.value;
  addToText[playerLetters.length-1] = document.createElement('input');
  addToText[playerLetters.length-1].className = 'inputLetters';
  if(showLetters){
    addToText[playerLetters.length-1].placeholder = playerLetters[playerLetters.length-1];
  } else {
    addToText[playerLetters.length-1].placeholder = '*';
  }
  playerword.appendChild(addToText[playerLetters.length-1]);
  wordToGuess = playerLetters.toString();
}

function click(button) {
  button.disabled = true;
  let letter = button.value;
  validateLetter(letter);
}

function validateLetter(letter) {
    if (wordToGuess.includes(letter)) {
      for (let letterIndex = 0; letterIndex < wordToGuess.length; ++letterIndex) {
        if (wordToGuess.charAt(letterIndex) === letter) {
          textToGuess[letterIndex].value = letter;
          ++countLetters;
          if (countLetters === wordToGuess.length) {
            keyboard.innerHTML = "";
            document.getElementById('life').innerHTML = "YOU WON !!!"
            //alert('You win');
          }
        }
      }
    } else {
      --lives;
      ++indexFrame;
      animation();
      setLife();
    }
}

function animation() {
  let imgPositions = [[10,0],[24,60],[24,60],[24,132],[46,121],[70,132],[73,113],[73,133],[105,133],[105,109],[50,125]];
  let frame = [];
  for (let indexImg = 1; indexImg <= imgPositions[0][0]; ++indexImg) {
    frame[indexImg] = new Image();
    frame[indexImg].src = `./images/${indexImg}.png`;
    if (indexImg === indexFrame) {
      document.getElementById('frames').appendChild(frame[indexImg]);
    }
  }
  placeIt(frame[indexFrame], imgPositions[indexFrame][0], imgPositions[indexFrame][1]);
}

function placeIt(frame, x, y) {
  frame.className = 'frame';
  frame.style.top = x + 'px';
  frame.style.left = y + 'px';
}

function getHint() {
  const hintList = ['hint1', 'hint2', 'hint3', 'hint4', 'hint5'];
  alert(hintList[randomNumber]);
}

function restart() {
  wordToGuess = [];
  textToGuess = [];
  playerLetters = [];
  addToText = [];
  keyboard.innerHTML="";
  word.innerHTML="";
  life.innerHTML="";
  document.getElementById('hide').style.display = 'none';
  document.getElementById('life').style.display = 'none';
  document.getElementById('startSinglePlayer').disabled = false;
  document.getElementById('startMultiPlayer').disabled = false;
  document.querySelectorAll('.frame').forEach(function(a) { a.remove();  }) // remove all frames added when user got the wrong letter
  //location.reload();
}



